// Lambda style
NSNotificationCenter.DefaultCenter.AddObserver (
        QTCaptureConnection.AttributeDidChangeNotification, (notification) => {Console.WriteLine ("Received the notification QTCaptureConnection", notification); }


// Method style
void Callback (NSNotification notification)
{
    Console.WriteLine ("Received a notification QTCaptureConnection", notification);
}

void Setup ()
{
    NSNotificationCenter.DefaultCenter.AddObserver (QTCaptureConnection.AttributeDidChangeNotification, Callback);
}

